import React from 'react'; 
import {Form, Input, Button} from 'antd'; 


const dummy = {
    isLoggedIn : true,  
    imagePaths : ['https://m.blog.naver.com/PostView.nhn?blogId=world199&logNo=220859367974&proxyReferer=https:%2F%2Fwww.google.com%2F&view=img_2'],
}


const Home = ()=>{

    return (
            <div>
                {dummy.isLoggedIn && <Form encType="multipart/form-data">               
                    <Input.TextArea maxLength={140} placeholder="어떤일이 있었나요?"/>
                <div>
                    <input type="file" multiple hidden />
                    <Button>이미지 업로드</Button>
                    <Button type="primary" style={{float:'right'}} htmlType="submit">짹짹</Button>
                </div>
                {dummy.imagePaths}
                </Form>}
            </div>
        )

}

export default Home;
